import React, { useEffect, useState } from 'react'

const Profile = (props) => {

    const [user, setUser] = useState();

    useEffect(() => {
        setUser(props.match.params.id);
    });



    return (
        <h1>Welcome, {user}</h1>
    )
}

export default Profile
